Жилой комплекс «Ancora Residence» — это семиэтажный дом премиум-класса. Спроектированные по соседству станция метро, средние школы, парки, современные бизнес- и торговые центры делают жилой комплекс Ancora Residence одним из самых удобных и привлекательных мест для проживания. Несомненно гордостью проекта является закрытый внутренний двор, полностью благоустроенный для Вашего приятного времяпрепровождения.

Здания оснащаются:

пожарной сигнализацией, видеонаблюдением, телекоммуникациями и охранной сигнализацией, объединенными в единую автоматизированную систему;
бесшумными скоростными лифтами «Mitsubishi»;
современной системой инженерных коммуникаций;
аварийной системой энергоснабжения.
Продается  2-х комнатная квартира. 3/7. Общая площадь 99,4  кв.м. «Под маяк». Цена за 1 кв.м. 1600 азн

